description:
Mother Lovers Society Vol 13 (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Elise has a secret: a secret that is about to tear her friends and their families apart. When Vivian's (Nina Hartley) daughter Phoebe (Samantha Rone) comes home unexpectedly, Vivian knows it's time to reveal the truth... that Phoebe isn't really her daughter, but Elise's. Elise will stop at nothing to conceal her lie, no matter what the consequence.

Cast: Julia Ann, - (bio),- (interview), Abella Danger, Natalia Starr, Nina Hartley, - (bio), Nina Elle, Samantha Rone, Jade Nile, Ela Darling, Melissa Monet,Director

